        </S.DescriptionCard>

        <S.RateCard>
            {values.map(value => console.log(value))}
            <Rate color='#B72825' value={0}/>
        </S.RateCard>
        <S.TextArea>

        </S.TextArea>
    </S.Container>

    )
}
